*{margin: 0; padding: 0;}

div.container{
    margin-top: 20px;

    width: 820px; height: 1050px;
    transform: translateX(38%);
    border: 1px solid #ddd;

    padding: 65px 38px 98px 36px;
}

.container .top .picture{
    width: 120px; height: 150px;
    border: 3px solid #e5e5e5;
    border-right: 4px solid #e5e5e5;
    border-left: 4px solid #e5e5e5;

    position: fixed;
    top: 60px;
    right: 38px;
}
.container .top h1{
    font-size: 30px; color: #292929;
}
.container .top p{
    font-size: 14px; color: #747474;
    margin-top: 16px; margin-bottom: 62px;
}

.container .basic{margin-bottom: 68px;}
.container .basic span.space{
    width: 2px; height: 16px;
    background: #b8b8b8;
    display: inline-block;
    margin: 0 2px;
}
.container h2{
    font-size: 20px; color: #292929;
}
.container .basic span{
    font-size: 14px; color: #747474;
}

.container .skills h2{ margin-bottom: 10px;}
.container .skills h3{
    font-size: 14px; color: #404040;
    line-height: 18px;
    padding-left: 14px;
    position: relative;

    margin: 3px 0;
}
.container .skills h3.other-three{ margin-top: 22px;}
.container .skills h3 span{
    color: #747474;
    font-size: 10px;
    display: inline-block;
    width: 6px; height: 6px;
    border-radius: 50%;
    background: #747474;
    margin-right: 6px;

    position: absolute;
    top: 6px; left: 0;
}
.container .skills p{
    font-size: 14px; color: #747474;
}

.container .works p.name{
    font-size: 14px; color: #666;
}
.container .works p.description{
    font-size: 14px; color: #888;
}
.container .works h2{ margin: 64px 0 10px 0;}
.container .works .work-wrapper{
    display: flex;
    justify-content: center;
    align-items: center;
}
.container .works .work-wrapper div.work{
    border: 1px solid #e9e9e9;
    min-width: 220px;
}
.container .works .work-wrapper div.work:nth-child(2){
    margin: 0 76px;
}

.container .experiences{ margin-top: 78px;}
.container .experiences h2{
    font-size: 20px; color: #292929;
}
.container .experiences p{
    font-size: 14px; color: #747474;
}
.container .experiences p.description{
    margin: 20px 0;
}
.container .experiences p.links{
    margin-top: 7px;
}

